# Command :- ixiangpf::emulation_ospf_network_group_config
# This example will configure a network group for OSPF
my $command_status = ixiangpf::emulation_ospf_network_group_config ({
    mode                                                        => "create",
    handle                                                      => "<ospfv2_handle>",
    type                                                        => "grid",
    grid_row                                                    => "2",
    grid_col                                                    => "3",
    active_router_id                                            => "1",
    router_id                                                   => "123.1.1.1",
    router_id_step                                              => "0.0.0.1",
    from_ip                                                     => "22.0.0.1",
    from_ip_step                                                => "0.0.0.2",
    to_ip                                                       => "23.0.0.1",
    to_ip_step                                                  => "0.0.0.3",
    external1_metric                                            => "1",
    external1_active                                            => "1",
    external1_network_address                                   => "10.0.0.1",
    external1_network_address_step                              => "0.0.0.1",
    external1_number_of_routes                                  => "1",
    external1_prefix                                            => "1",
    external2_active                                            => "0",
    nssa_active                                                 => "0",
    stub_active                                                 => "0",
    summary_active                                              => "0",
});
# The command above will generate output as shown below:
# {status 1} {network_group_handle networkGroupHandle} 
# {sim_interface_ipv4_config_handle simInterfaceipv4ConfigHandle} 
# {simulated_interface_handle simulatedInterfaceHandle} 
# {simulated_router_handle simulatedRouterHandle} 
# {external1_handle externalHandle} 
# {external2_handle externalhandle} 
# {nssa_handle nssaHandle} 
# {stub_handle stubHandle} 
# {summary_handle summaryHandle}
